import React from 'react';
import { Link } from 'react-router-dom'; // For navigation links

function Header() {
  return (
    <header className="header">
      <h1 className="logo">Doctro</h1>
      <img src='images/Doctro2.jpg'alt='Doctro Logo'className='logo'></img>
      <nav className="nav">
        <Link to="/" className='Home-btn' style={{color:'white'}}>Home</Link>
        {/* <Link to="#services" className='Service-btn' style={{color:'white'}}>Our Services</Link> */}
        <Link to="/about" className='About-btn' style={{color:'white'}}>About Us</Link>
        <Link to="/doctor-form" className='Doctor-btn'style={{color:'white'}}>Doctor Login </Link>
        <Link to="/patient-form" className='Patient-btn'style={{color:'white'}}>Patient Login</Link>
      </nav>
    </header>
  );
}

export default Header;
